import React from "react";
import Api from "../api/api";
import Card from "../Card/cards";

const Process = props => (
  <div>
    {Api.map(({ pic, name, desc }) => (
      <>
        <Card imge={pic} name={name} desc={desc} />
      </>
    ))}
  </div>
);

export default Process;
